



/* canvas 1*/ 

var sketch1 = function (p) { // var sketch 1 = function is allowing this canvas to be created as div, this allows us to create multiple canveses if needed.
  let skate; 

p.preload = function() { // this pre load function allows the us to keep this image stored before loading the site, thus preload.

skate = p.loadImage('data:image/png;base64,')

}

p.setup = function () { // setup = function allows us to create a canvas,as well as variables and functions that can be called to from other functions simialr to a global var.  

var canvas = p.createCanvas(500,500).position(450,300); // .position allows us to move the canvas to the desired location.
p.background(192,10,52); 
p.noStroke();

canvas.parent ('frm1'); // this canvas parent allows this canves to be created on to an html page as a  div. 
}
 

 p.draw = function() { // draw function allows us to us functions that can create new elements such as circles, rectangles triangles etc, this also allows us to munipulate these objects as well be adding varibles and commands/function.


p.background(192,10,52);
p.fill(17,151,39);
p.image(skate,p.frameCount * 1,100); // frame count essentially recreates  an image or obect in realtion to the framecount. 

if (p.frameCount > p.width) { // this allows us to reset the image based on where the image has met the stated value, in this case the width of the canvas(500)

  p.frameCount = -300; // this is the value chosen too reset the imagtion after it has met the stated value.
} 

}

}

/* canvas 2 */

var sketch2 = function(p){

let pic; 

p.preload = function() {
pic = p.loadImage('data:image/jpeg;base64, ');
  
}


p.setup = function() {


	var canvas = p.createCanvas(500,500, p.WEBGL).position(450, 900); // WEBGL changes the canvas to allow 3D objects or models, simple way to look at this is that WEBGL is the "z-axis"
	p.background(10,10,192);
p.smooth();

canvas.parent('frm2');
}

p.draw = function(){

p.background(10,10,192);
 p.rotateX(p.frameCount * 0.01); // this allows for the object to rotate on a axis in this case the "x" axis. 
 p.rotateY(p.frameCount * 0.03);
 p.noStroke();
 p.texture(pic); // this allows us to call to the pic preload function and allows us to apply it to a desired object.
 p.sphere(90);
  }

}

